                    { 29, 10, null, 29000m, null, null, null, "r29.docx", "55670f5c-1a39-4af2-98dc-39435a09e10f", null, "edorsey9@hc360.com", true, null, null, null, "Nghiên cứu viên UX có kinh nghiệm với lịch sử trong lĩnh vực tương tác người-máy. Có kinh nghiệm trong phương pháp nghiên cứu chất lượng và lượng, bao gồm phỏng vấn người dùng, khảo sát và kiểm tra tính khả dụng. Thạo việc tổng hợp các kết quả nghiên cứu để hỗ trợ quyết định thiết kế và cải thiện trải nghiệm người dùng.", true, false, null, null, null, "$2a$04$n30zXjTuTTbmcuN9cA6I.eblO8E4/JL1p9OIKzgkiu7MGAAGyB4Ya", null, false, "i29.png", null, null, (short)1, true, "Emmet Dorsey" },
                    { 30, 4, null, 30000m, null, null, null, "r30.pdf", "7c737b4c-3022-4af7-9064-944a0c72cb8a", null, "cgoldsberrya@shareasale.com", false, null, null, null, "Nhà nghiên cứu UX chuyên về phân tích hành vi người dùng và đồng hành. Thạo việc thu thập và phân tích dữ liệu người dùng để xác định các vấn đề và cơ hội cải thiện. Có kinh nghiệm trong việc làm việc cùng các nhóm chức năng khác nhau để chuyển đổi những hiểu biết nghiên cứu thành các đề xuất thiết kế hành động.", false, false, null, null, null, "$2a$04$IXQDrcm52R..rKAOy0WTP.IXQVPdpS5y5YS/thyvNdXPoQ0lH7dZ6", null, false, "i30.png", null, null, (short)1, false, "Cahra Goldsberry" },
                    { 31, 10, null, 31000m, "Multiple Infractions", null, null, "r31.pdf", "f9674fa3-e356-4ac0-a867-2470e7b5fab1", null, "pwulfingerb@posterous.com", true, new DateTime(2023, 4, 11, 12, 25, 0, 0, DateTimeKind.Unspecified), null, null, "Nhà nghiên cứu UX có chuyên môn về tâm lý học hành vi con người. Có kinh nghiệm trong việc tiến hành các nghiên cứu người dùng, đánh giá tiêu chuẩn và kiểm tra hành trình tư duy. Thạo việc áp dụng các nguyên lý tâm lý học vào việc thiết kế giao diện người dùng.", true, true, null, null, null, "$2a$04$hH/0kPq.q9I9KsD/lmHE9eJQ.D2QsDu2v.15O7vRxWiiTL8cHLxe2", null, false, "i31.png", null, null, (short)0, true, "Paulette Wulfinger" },
                    { 32, 10, null, 32000m, null, null, null, "r32.pdf", "18bacf1d-b476-4aa7-bfa6-713a49c22d0f", null, "ewesgatec@china.com.cn", true, null, null, null, "Nhà nghiên cứu UX với sự chú trọng vào khả năng tiếp cận và thiết kế bao gồm mọi người. Có kinh nghiệm trong việc tiến hành kiểm tra khả dụng và kiểm tra hành vi với các nhóm người dùng đa dạng, bao gồm cả những người khuyết tật. Thạo việc thúc đẩy các nguyên tắc thiết kế có sẵn và tuân thủ các hướng dẫn về tiếp cận.", true, true, null, null, null, "$2a$04$lx0OqGz.N4PNpbXT18LQI.LIRw03DGzpNWet/nlAJwjCdaD6nphoi", null, true, "i32.png", null, null, (short)1, true, "Eberto Wesgate" },
                    { 33, 2, null, 33000m, null, null, null, "r33.pdf", "89aa06db-0a22-4ab4-a598-ffa4e62764ca", null, "jfaircleyd@upenn.edu", false, null, null, null, "Nhà nghiên cứu UX chuyên về nghiên cứu dân số và phân loại người dùng. Thạo việc xác định các nhân vật người dùng, tiến hành phân tích cạnh tranh và thu thập thông tin thị trường để hỗ trợ chiến lược sản phẩm. Có kinh nghiệm trong việc áp dụng các phương pháp dựa trên dữ liệu để tối ưu hóa trải nghiệm người dùng.", false, false, null, null, null, "$2a$04$nm9YQ1icfNU4CizCPQonmehLkZZmv6E2OLXIz2z/kXQqgbSyfC0cq", null, true, "i33.png", null, null, (short)1, true, "Jacky Faircley" },
                    { 34, 6, null, 34000m, "Account sharing or impersonation", null, null, "r34.pdf", "3af647f8-12db-4624-8f68-707a197a37c0", null, "bcatleye@wikispaces.com", true, new DateTime(2023, 1, 19, 20, 29, 0, 0, DateTimeKind.Unspecified), null, null, "Nhà nghiên cứu UX với sự chuyên sâu trong phân tích nghiên cứu dân tộc và kiểm tra ngữ cảnh. Thạo việc tiến hành các nghiên cứu trường học và quan sát để hiểu hành vi người dùng trong môi trường thực tế. Có kinh nghiệm trong việc chuyển đổi những hiểu biết về dân tộc thành cơ hội thiết kế cho các sản phẩm và dịch vụ số.", true, false, null, null, null, "$2a$04$j6twwudj2WPEO76NUsqDdOBew7PO4Rc7BpFiwbGVq48tvXq6PTegi", null, false, "i34.png", null, null, (short)0, true, "Bertie Catley" },
                    { 35, 7, null, 35000m, null, null, null, "r35.pdf", "2f7e50f7-98fa-44f7-b32c-33d5b13c2da0", null, "esaylorf@last.fm", false, null, null, null, "Nhà nghiên cứu UX với sự chuyên sâu về an toàn và thiết kế bao gồm mọi người. Có kinh nghiệm trong việc tiến hành kiểm tra khả dụng và kiểm tra hành vi với các nhóm người dùng đa dạng, bao gồm cả những người khuyết tật. Thạo việc thúc đẩy các nguyên tắc thiết kế có sẵn và tuân thủ các hướng dẫn về an toàn.", true, false, null, null, null, "$2a$04$XZTxljewq5F7en46SZj9R.y8Z7wz0dHdrdGAG2NO36WR3sCo6PrMG", null, true, "i35.png", null, null, (short)1, true, "Evelina Saylor" },
                    { 36, 3, null, 36000m, "Violation of copyright or intellectual property rights", null, null, "r36.pdf", "fe50e94e-91f3-453a-b995-65b97ffb1e32", null, "cfitzackerleyg@miitbeian.gov.cn", false, new DateTime(2023, 5, 8, 13, 33, 0, 0, DateTimeKind.Unspecified), null, null, "Nhà nghiên cứu UX mới bắt đầu nhiệt huyết với sự học hỏi và đóng góp cho các dự án nghiên cứu. Thạo việc tiến hành phỏng vấn người dùng, kiểm tra tính khả dụng và khảo sát để thu thập phản hồi và hiểu biết từ người dùng. Hăng hái hợp tác với các nhà nghiên cứu kinh nghiệm để cải thiện chức năng và trải nghiệm của sản phẩm.", true, true, null, null, null, "$2a$04$pBof1tLNUgaAQRbOm7ENmeuZoJr96dn1PLtpsgrveEdHXCG0buKy2", null, true, "i36.png", null, null, (short)0, false, "Chas Fitzackerley" },
                    { 37, 7, null, 37000m, null, null, null, "r37.pdf", "65ca6f33-dba0-4fe0-a27b-56b8ba3107a8", null, "sohowbaneh@globo.com", true, null, null, null, "Nhà nghiên cứu UX với sự chuyên sâu về số liệu và phân tích. Có kinh nghiệm trong việc xác định các chỉ số hiệu suất chính, thiết lập các công cụ phân tích và phân tích dữ liệu người dùng để đo lường và cải thiện hiệu suất UX. Thạo việc trực quan hóa dữ liệu và truyền đạt hiểu biết cho các bên liên quan một cách hiệu quả.", false, false, null, null, null, "$2a$04$lS.n44udNYDZVUqDRgbwp.1F0VZgNhSAl20Sqynr4Xo.wGt15ypDC", null, true, "i37.png", null, null, (short)1, true, "Sharity O'Howbane" },
                    { 38, 7, null, 38000m, null, null, null, "r38.pdf", "4b0624f9-efee-4ad2-a1ce-b4f52c29049c", null, "nmatysiaki@amazonaws.com", false, null, null, null, "Nhà nghiên cứu UX với sự chuyên sâu trong việc thực hiện nghiên cứu về tâm lý học và kinh tế học hành vi. Có kinh nghiệm trong việc áp dụng các lý thuyết tâm lý học vào nghiên cứu UX, chẳng hạn như các heuristics quyết định và mô hình tư duy. Thạo việc tiến hành các nghiên cứu theo dõi mắt và kiểm tra A/B để tối ưu hóa giao diện người dùng và tương tác.", true, false, null, null, null, "$2a$04$T3Vij/zpGwLiHr8q22CBT.HSMGzlNNYVU4YhAOJZ0kU5uPhI4mgxa", null, true, "i38.png", null, null, (short)1, true, "Nikoletta Matysiak" },
                    { 39, 3, null, 39000m, "Creating or participating in unauthorized competitions or giveaways", null, null, "r39.pdf", "963754f1-7b27-4d76-a9d7-865f07716f68", null, "dkobierzyckij@yahoo.com", true, new DateTime(2023, 10, 20, 2, 46, 0, 0, DateTimeKind.Unspecified), null, null, "Kỹ sư Machine Learning có kinh nghiệm trong việc xây dựng và triển khai các mô hình học máy. Thạo việc tiền xử lý dữ liệu, lựa chọn mô hình phù hợp và tinh chỉnh tham số để đạt được hiệu suất tốt nhất. Sẵn lòng tham gia vào các dự án thú vị và học hỏi từ những kỹ sư hàng đầu.", false, true, null, null, null, "$2a$04$AL64EqKymYrsBb/mwy2v0.uH3Ye7R0a4lK.YhCIlF4EZEk/TkWD3q", null, true, "i39.png", null, null, (short)0, true, "Darda Kobierzycki" },
                    { 40, 10, null, 40000m, "Posting explicit or graphic content", null, null, "r40.pdf", "04039091-2eaf-47f7-bba3-904d62685f12", null, "awatchornk@bigcartel.com", true, new DateTime(2023, 6, 25, 12, 39, 0, 0, DateTimeKind.Unspecified), null, null, "Kỹ sư Machine Learning với kiến thức vững về học sâu và học máy. Có kinh nghiệm trong việc áp dụng các mô hình CNN, RNN, và Transformer cho các bài toán nhận diện, dự đoán và dịch ngôn ngữ. Nhiệt tình với việc nghiên cứu và áp dụng các công nghệ mới nhất trong lĩnh vực.", true, true, null, null, null, "$2a$04$R7Et/9gWTUMrsrjE2t3h9.bI10ezjnl5YJjtdmRrWQSDOQtulPx6i", null, false, "i40.png", null, null, (short)0, true, "Arielle Watchorn" },
                    { 41, 10, null, 41000m, null, null, null, "r41.pdf", "72fa7754-e984-43c5-954d-dbe441ee005f", null, "eewensonl@google.com.hk", false, null, null, null, "Kỹ sư Machine Learning chuyên sâu về thị giác máy tính và xử lý ảnh. Có kinh nghiệm trong việc xây dựng các hệ thống nhận diện khuôn mặt, phát hiện vật thể và phân tích hình ảnh y tế. Sẵn lòng tìm hiểu và thử nghiệm các phương pháp mới để cải thiện hiệu suất của các ứng dụng.", false, true, null, null, null, "$2a$04$pYXTTsJ8GeRmnUP2DZHwWuUUruSwAEm2aonwARv.O7dDgPa9PGeq6", null, false, "i41.png", null, null, (short)1, false, "Elnar Ewenson" },
                    { 42, 8, null, 42000m, "Engaging in cyberbullying or targeted harassment", null, null, "r42.pdf", "1eba447f-1901-43fc-95c9-0645ea3a648f", null, "rschindlerm@ebay.com", false, new DateTime(2023, 10, 16, 11, 41, 0, 0, DateTimeKind.Unspecified), null, null, "Kỹ sư Machine Learning với kỹ năng tốt về xử lý dữ liệu lớn và học máy phân tán. Có kinh nghiệm trong việc triển khai các mô hình học máy trên cơ sở dữ liệu phân tán và hệ thống phân tán. Sẵn lòng tham gia vào các dự án có quy mô lớn và phức tạp.", false, false, null, null, null, "$2a$04$Ewz8pVwm1Uxz4S01.LIgLe3Q/JHk/SJb4R1h8.NtWgfyrusGAMYY6", null, true, "i42.png", null, null, (short)0, true, "Roldan Schindler" },
                    { 43, 2, null, 43000m, null, null, null, "r43.pdf", "4ff8bd42-59b5-4b60-b861-b7cae785d616", null, "vhonschn@nature.com", false, null, null, null, "Kỹ sư Machine Learning có chuyên môn về xử lý ngôn ngữ tự nhiên và hiểu ngôn ngữ tự nhiên. Có kinh nghiệm trong việc xây dựng các hệ thống gợi ý, phân loại văn bản và dịch máy. Nhiệt tình với việc áp dụng học sâu và phương pháp trích xuất thông tin để giải quyết các thách thức trong lĩnh vực này.", true, false, null, null, null, "$2a$04$B7.HuHmcItU.ZdKOtAk/Me3FuantzbaX8rCW890RfHnV29a.YoNC2", null, false, "i43.png", null, null, (short)1, false, "Vina Honsch" },
                    { 44, 4, null, 44000m, "Threatening or inciting violence", null, null, "r44.pdf", "2d2f6a26-8575-41f0-8bcb-db74f60e7436", null, "hnoelo@biblegateway.com", true, new DateTime(2023, 8, 8, 1, 41, 0, 0, DateTimeKind.Unspecified), null, null, "Kỹ sư Machine Learning với kiến thức vững về học tăng cường và học máy tăng cường. Có kinh nghiệm trong việc áp dụng các thuật toán Q-learning, DQN và các phương pháp tối ưu hoá chính sách để giải quyết các bài toán điều khiển và quyết định. Sẵn lòng tham gia vào các dự án về học máy tăng cường và đóng góp ý kiến.", false, false, null, null, null, "$2a$04$FkX1Z1iJdEki68AWZTb7UenoSjvba6jYKQg/J3WevQzvvmvPz0Qse", null, true, "i44.png", null, null, (short)0, true, "Hamlen Noel" },
                    { 45, 7, null, 45000m, null, null, null, "r45.pdf", "4833317b-3bc0-4fdc-9cac-83d7aa364a14", null, "bgermanp@edublogs.org", true, null, null, null, "Kỹ sư Machine Learning có kinh nghiệm trong việc xây dựng hệ thống gợi ý và hệ thống lọc cộng tác. Có kiến thức sâu về các thuật toán cơ bản như collaborative filtering và content-based filtering, cũng như các phương pháp tiên tiến như matrix factorization và deep learning. Nhiệt tình với việc nghiên cứu và triển khai các giải pháp gợi ý hiệu quả.", true, false, null, null, null, "$2a$04$BO2hCS7qr8nl4d0XO6kZTuyn1cscbAxsoQoos8kGBaGZozSDeJVoW", null, true, "i45.png", null, null, (short)1, true, "Bernardina German" },
                    { 46, 9, null, 46000m, "Doxxing or sharing personal information without consent", null, null, "r46.pdf", "7b8a290c-b8a0-4d77-9964-75e6f563bc78", null, "ometterickq@si.edu", true, new DateTime(2023, 7, 14, 4, 39, 0, 0, DateTimeKind.Unspecified), null, null, "Kỹ sư Machine Learning với kỹ năng tốt về phân tích dữ liệu và dự báo. Có kinh nghiệm trong việc sử dụng các thuật toán học máy và thống kê để dự báo xu hướng và xu hướng trong dữ liệu. Sẵn lòng tham gia vào các dự án phức tạp và đóng góp ý kiến xây dựng mô hình.", true, false, null, null, null, "$2a$04$tSjWDxMvzPu9KblXaPaRZ.a0kRSUDaD9lidva9wVn68txT8E8aDp.", null, true, "i46.png", null, null, (short)0, true, "Ollie Metterick" },
                    { 47, 10, null, 47000m, null, null, null, "r47.pdf", "4f2975b5-cf84-46d7-9199-af479a9ba668", null, "wglanertr@technorati.com", true, null, null, null, "Kỹ sư Machine Learning mới vào nghề, đầy nhiệt huyết và sẵn lòng học hỏi. Có kiến thức cơ bản về các thuật toán học máy và kinh nghiệm trong việc xử lý dữ liệu. Năng động và hợp tác trong môi trường làm việc nhóm.", true, false, null, null, null, "$2a$04$yimp1eJifnBgzhTPro9D9uKItP14jP5HRPZpPsL/36WCz7phoRCUW", null, false, "i47.png", null, null, (short)1, true, "Winna Glanert" },
                    { 48, 8, null, 48000m, "Exploiting vulnerabilities in the platform's security", null, null, "r48.pdf", "74889032-de68-4b6f-b916-df1aae9c075b", null, "plongdons@so - net.ne.jp", false, new DateTime(2023, 2, 25, 14, 49, 0, 0, DateTimeKind.Unspecified), null, null, "Kỹ sư Machine Learning với kinh nghiệm rộng trong việc xử lý dữ liệu cấu trúc và không cấu trúc. Có kỹ năng tốt trong việc lựa chọn, triển khai và tinh chỉnh mô hình học máy. Sẵn lòng chia sẻ kiến thức và kinh nghiệm với đồng nghiệp mới.", true, true, null, null, null, "$2a$04$Mu71kQEib0BOLMwPRzYsm.U4CWkkjrGUPXS92zr6Z4yWM5DMkjaye", null, false, "i48.png", null, null, (short)0, true, "Perry Longdon" },
                    { 49, 7, null, 49000m, null, null, null, "r49.pdf", "e8e0a5f6-0998-4d31-ace6-40ca01168f47", null, "sgrealisht@netvibes.com", false, null, null, null, "là một Project Manager có kinh nghiệm với niềm đam mê đưa sự hòa hợp vào mỗi dự án mà cô đảm nhận. Với lý lịch trong lĩnh vực kỹ thuật phần mềm, cô liên kết một cách trơn tru sự chuyên môn kỹ thuật với kỹ năng quản lý dự án. Sự bình tĩnh và kỹ năng giao tiếp mạnh mẽ của Namita khiến cô trở thành một nhà lãnh đạo tự nhiên, tài ba trong việc chỉ đạo đội ngũ đạt được kết quả dự án thành công. Sự yêu thích của Namita với âm nhạc và vũ điệu cổ điển Ấn Độ phản ánh qua cách tiếp cận quản lý dự án của cô, nơi cô điều phối các nhiệm vụ một cách chính xác và tinh tế, đảm bảo mọi khía cạnh của dự án diễn ra một cách hoàn hảo", false, true, null, null, null, "$2a$04$lVRSYIkuZsasAcJPy1FsyOitl6HybOG5rqT6jzZ.aRwp/EgmrLNI.", null, false, "i49.png", null, null, (short)1, true, "Salomi Grealish" }
                });

