                    { 64, 6, null, 64000m, null, null, null, "r64.docx", "a1ee56ea-b459-4a07-af87-ed195dffb6fc", null, "apassman18@blogs.com", false, null, null, null, "Benjamin, armed with a background in computer science or software engineering, is a master of programming languages and game engines. He thrives on solving technical challenges and pushing the boundaries of what's possible in game development through innovative gameplay mechanics and cutting-edge technology", true, false, null, null, null, "$2a$04$COucln69MUQWz8WeMhR81eAYnCrOAr4ABIBwCsHSV32rMJgPYeTIW", null, true, "", null, null, (short)1, false, "Abigale Passman Benjamin" },
                    { 65, 2, null, 65000m, "Continuously disrupting community events or discussions", null, null, "r65.docx", "e3b1186b-50c4-4dc5-84b2-f51ff1576c67", null, "iewington19@tamu.edu", false, new DateTime(2023, 10, 17, 19, 24, 0, 0, DateTimeKind.Unspecified), null, null, "Claire, with a degree in fine arts or graphic design, has a talent for creating visually stunning game worlds and characters. Her creativity knows no bounds as she crafts breathtaking landscapes, intricate character designs, and captivating animations that bring games to life.", true, false, null, null, null, "$2a$04$8h6SDxbdE1x65GFfC48uBOEadXN0mKucOXrKmHzHUf1MtvsRv2a7S", null, false, "", null, null, (short)0, false, "Igor Ewington Claire" },
                    { 66, 9, null, 66000m, null, null, null, "r66.docx", "3a6b2efb-8994-41f2-a11f-c8bf79c8b7e9", null, "hangerstein1a@godaddy.com", true, null, null, null, "Tôi là một Backend Developer với 5 năm kinh nghiệm trong ngành công nghệ thông tin. Trình độ chuyên môn của tôi tập trung vào lập trình Java và Python, cùng với các kỹ năng vững về xử lý dữ liệu và tối ưu hóa hiệu suất. Tôi đã tham gia vào nhiều dự án lớn, từ các ứng dụng web đến các hệ thống quản lý cơ sở dữ liệu phức tạp. Sự kiên nhẫn và ham học hỏi là những điểm mạnh của tôi, và tôi luôn mong muốn thách thức bản thân để phát triển mỗi ngày.", false, false, null, null, null, "$2a$04$7ZK8ncz5okb46SXMi2aX/OFn9uu1KmEedijLd68QYqC5vfb82w2Me", null, false, "i66.png", null, null, (short)1, true, "Holmes Angerstein" },
                    { 67, 9, null, 67000m, null, null, null, "r67.docx", "9a494d3e-2ccd-41fd-bbf2-ea324ccd715e", null, "kfehely1b@amazon.co.jp", false, null, null, null, "một Backend Developer với 3 năm kinh nghiệm. Tôi có kiến thức sâu rộng về lập trình Python và Node.js, cũng như về các công nghệ liên quan đến cơ sở dữ liệu như MySQL và MongoDB. Tôi luôn muốn học hỏi và khám phá những công nghệ mới, và tôi tin rằng việc này giúp tôi ngày càng phát triển và đóng góp nhiều hơn trong dự án mà tôi tham gia.", false, true, null, null, null, "$2a$04$STs4qX6wgYma/k.0Qxap3.ApRyNYRZ.moD849n.URGRUZjVEuF7sS", null, false, "i67.png", null, null, (short)1, false, "Kasper Fehely" },
                    { 68, 5, null, 68000m, "Violation of Community Guidelines", null, null, "r68.docx", "0776ab19-0ac3-4d74-99d1-ec60a1a45642", null, "jcassley1c@harvard.edu", false, new DateTime(2023, 12, 27, 5, 40, 0, 0, DateTimeKind.Unspecified), null, null, "Tôi là một Backend Developer tận tụy với hơn 4 năm kinh nghiệm trong ngành phát triển phần mềm. Sở trường của tôi nằm ở việc xây dựng các hệ thống phức tạp bằng Java và PHP. Tôi luôn chú trọng đến việc viết mã sạch và hiệu quả, cũng như đảm bảo tính ổn định và bảo mật cho ứng dụng. Sự cam kết và trách nhiệm là hai đặc điểm quan trọng trong cách làm việc của tôi.", false, true, null, null, null, "$2a$04$4fFaXEcih4iFQOn40vDLx.9th9oc56K7njiCobya/QCj0tuCNqhs.", null, true, "i68.png", null, null, (short)0, true, "Janean Cassley" },
